import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = (props) => {

  let postsData = [
    {id: 1, message: 'random post text', likes: '73'},
    {id: 2, message: 'random post text#2', likes: '73'},
  ]

  return (
    <div>
      My posts
      <div>
        <textarea></textarea>
        <button>Add post</button>
      </div>
      <div className={s.posts}>
        <Post message='Hi, how are you?' likes='73'/>
        <Post message="It's my first post" likes='34'/>
      </div>
    </div>
  )

}

export default MyPosts;
